  \"\",\n\t\t\"description\": \"The individual shapefiles in this dataset delineate
  estimated temperature contours (20u02daC, 40u02daC, 60u02daC, and 80u02daC) at a
  depth of 200 m in the Milford, Utah FORGE area.  Contours were derived from 86 geothermal,
  gradient, and other wells drilled in the area since the mid-1970s with depths greater
  than 50 m.  Conductive temperature profiles for wells less than 200 m were extrapolated
  to determine the temperature at the desired depth.  Because 11 wells in the eastern
  section of the study area (in and around the Mineral Mountains) are at higher elevations
  compared to those closer to the center of the basin, temperature profiles were extrapolated
  to a constant elevation of 200 m below the 1830 m (6000 ft) a.s.l. datum (approximate
  elevation of alluvial fans at the base of the Mineral Mountains) to smooth the contours
  across the ridges and valleys.  \",\n\t\t\"format\": \"ZIP\",\n\t\t\"tracking_summary\":
